Heres the Config located in hacks/config

// 0 - 1
kzh_autoduck 0
// 0 - 1
kzh_autojump 0
// 0 - 20
kzh_autojump_units 15
// 0 - 1
kzh_bhop 1
// 0 - 1
kzh_bhop_standup 0
// 0 - 1
kzh_cam 0
// -89 - 89
kzh_fixedpitch 0
// 0 - 360
kzh_fixedyaw 0
// 0 - 1
kzh_noflash 1
// 0 - 1
kzh_nosmoke 1
// 0 - 20
kzh_speed 1
// 0 - 1
kzh_speed_method 1

// this is a command to toggle fullbright
// kzh_fullbright

// to execute .cfg files in this folder use i.e.
// kzh_exec kzh_strafe.cfg

// just some aliases
alias slowspeed "kzh_speed 0.3"
alias fastspeed "kzh_speed 20"

// some binds
// kzh_later 5 "bind mouse4 hang"
// kzh_later 5 "bind r cam_tog"
// kzh_later 5 "bind t +ramp"
kzh_later 5 "bind mouse4 +sw.str

// slowmo with keyholding
alias +slowmo "slowspeed"
alias -slowmo "kzh_speed 1"

// slowmo toggle
alias slowmo_toggle "slowmo_toggle_on"
alias slowmo_toggle_on "slowspeed; alias slowmo_toggle slowmo_toggle_off"
alias slowmo_toggle_off "kzh_speed 1; alias slowmo_toggle slowmo_toggle_on"

// ramping with keyholding
alias +ramp "fastspeed"
alias -ramp "kzh_speed 1"

// hand in midair toggle
alias hang "hang_on"
alias hang_on "kzh_speed 0.0001; alias hang hang_off"
alias hang_off "kzh_speed 1; alias hang hang_on"

// 3rd person toggle
alias cam_tog "cam_tog_on"
alias cam_tog_on "kzh_cam 1; alias cam_tog cam_tog_off"
alias cam_tog_off "kzh_cam 0; alias cam_tog cam_tog_on"

// gvd toggle (yaw 180 & pitch 89)
alias gvd "gvd_on"
alias gvd_on "kzh_fixedyaw 180; kzh_fixedpitch 89; alias gvd gvd_off"
alias gvd_off "kzh_fixedyaw 0; kzh_fixedpitch 0; alias gvd gvd_on"

//strafes
alias rightstrafe "-forward ; kzh_yawspeed -320; +moveright; +kzh_right; wait2; kzh_yawspeed 500; wait5 ; -kzh_right; -moveright"
alias leftstrafe "-forward ; kzh_yawspeed -320; +moveleft; +kzh_left; wait2; kzh_yawspeed 500; wait5 ; -kzh_left; -moveleft"

alias +sw23.str "alias kzh_xtd @sw23.str;@sw23.str"
alias -sw23.str "alias kzh_xtd"
alias @sw23.str "leftstrafe;rightstrafe; kzh_loopx td"

//waits
alias wait3 "wait; wait; wait"
alias wait2 "wait; wait"
alias wait4 "wait2; wait2"
alias wait5 "wait4; wait"
alias wait6 "wait5; wait"
alias wait7 "wait5; wait2"
alias wait8 "wait7; wait"
alias wait9 "wait8; wait"
alias wait10 "wait9; wait"

Okey... to jump longer and strafe much more write this in console ..

bind "A" "+moveleft;wait;developer 1;fps_max 200"

and then this

bind "d" "+moveright;wait;developer 1;fps_max 200"

and then this

bind "MWHEELDOWN" "+jump;wait;developer 1;fps_max 200"

and then this

developer 1

and then this

fps_max 200

and then this... this is the strafe button u strafe with

bind mouse3 +sw23.str

that means u will strafe with mouse3 but its your choise.

and to use slowmo write bind "f" +slowmo

and if it will stands something like kzh_bhop or something developer when you connect to a server you cant use this binds on that server so u have to delete ur config.cfg located in valve/steam/steamapps/cstrike/config.cfg just delete it and only write fps_max 200 in console to use the hack on that server you will not jump as much as you did before. but just write all the binds again in console to jump longer on other servers! PLS SUBSCRIBE AND RATE 5/5 ! COMMENT IF YOU NEED HELP! THANKS!

My first CSS video i get a good and respectable score, i havent had this game very long so sorry if its not upto your standard. I will improve as time goes on.
//Dave

